import react from "react";

export default function Greet() {
  return react.createElement(
    "div",
    null,
    react.createElement(
      "h1",
      { className: "hello", style: { color: "red" } },
      "hello with create element"
    ),
    react.createElement(
      "h1",
      { className: "hello", style: { color: "red" } },
      "hello with create element 2"
    )
  );
}
